import '../CSS/header.css';

function Header() {
    return (
        <div class="topnav">
        <a href="Home"><b>Home</b> </a>
        <a href="Exams"><b>Exams</b></a>
        <a href="Profile"><b>Profile</b></a>
        <a href="Services"><b>Services</b></a>
        <a href="About"><b>About</b></a>
      </div>
    );
  }
  
  export default Header;
